def get_tags(data):
    txt = []
    data = json.loads(data.strip(), strict=False)
    for post in data['entry_data']['TagPage'][0]['graphql']['hashtag']['edge_hashtag_to_top_posts']['edges']:
        caption = post['node']['edge_media_to_caption']['edges'][0]['node']['text'].split(" ")
        for text in caption:
            if text.strip().startswith('#') and text.strip() not in txt:
                txt.append(text.strip())
    return txt
